"use strict";

function countMaxOrSubsets(nums) {
    let mx = 0, ans = 0;
    for (let x of nums) {
        mx |= x;
    }
    function dfs(i, t) {
        if (i === nums.length) {
            if (t === mx) {
                ans += 1;
            }
            return;
        }
        dfs(i + 1, t);
        dfs(i + 1, t | nums[i]);
    }
    dfs(0, 0);
    return ans;
}
